        #region Estrutura do Banco de Dados
        public static string gerarTabelaConvenio()
        {
            string query;
            query = "create table if not exists convenio (";
            query += "seqconvenio Integer PRIMARY KEY ON CONFLICT ROLLBACK AUTOINCREMENT Not NULL,";
            query += "seqpessoa   Integer Not NULL On CONFLICT ROLLBACK,";
            query += "valor       decimal(12,2) Not NULL,";
            query += "ultnome     text Not NULL,";
            query += "ultdata     datetime default (datetime('now','localtime')),";
            query += "CONSTRAINT fk_seqpessoa FOREIGN KEY(seqpessoa) REFERENCES pessoa(seqpessoa))";

            return query;
        }

        public static string gerarTabelaPessoa()
        {
            string query;
            query = "create table if not exists pessoa (";
            query += "seqpessoa   Integer PRIMARY KEY ON CONFLICT ROLLBACK AUTOINCREMENT Not NULL,";
            query += "cnpjcpf     text ,";
            query += "ierg        text ,";
            query += "razaonome   text Not NULL,";
            query += "fantasia    text ,";
            query += "cep         text ,";
            query += "endereco    text ,";
            query += "numero      text ,";
            query += "complemento text ,";
            query += "bairro      text ,";
            query += "cidade      text ,";
            query += "uf          text ,";
            query += "tipo        integer Not NULL,";
            query += "ativo       boolean Not NULL,";
            query += "ultnome     Text Not NULL,";
            query += "ultdata     datetime default (datetime('now','localtime')))";

            return query;
        }

        public static string gerarTabelaFormaPagto()
        {
            string query;
            query = "create table if not exists formapagto (";
            query += "seqformapagto Integer PRIMARY KEY ON CONFLICT ROLLBACK AUTOINCREMENT Not NULL,";
            query += "descricao     text not null ON CONFLICT ROLLBACK,";
            query += "ativo         boolean not null,";
            query += "ultnome       text not null,";
            query += "ultdata       datetime default (datetime('now','localtime')))";

            return query;
        }

        public static string gerarTabelaMarca()
        {
            string query;
            query = "create table if not exists marca (";
            query += "seqmarca  Integer PRIMARY KEY ON CONFLICT ROLLBACK AUTOINCREMENT Not NULL,";
