            query += "ultnome   Text Not NULL,";
            query += "ultdata   datetime default (datetime('now','localtime')))";

            return query;
        }

        public static string gerarTabelaModelo()
        {
            string query;
            query = "create table if not exists modelo (";
            query += "seqmodelo Integer PRIMARY KEY ON CONFLICT ROLLBACK AUTOINCREMENT Not NULL,";
            query += "seqmarca  text Not NULL,";
            query += "descricao text Not NULL On CONFLICT ROLLBACK,";
            query += "ultnome   Text Not NULL,";
