            query += "CONSTRAINT fk_seqmarca FOREIGN KEY(seqmarca) REFERENCES marca(seqmarca))";

            return query;
        }

        public static string gerarTabelaMovimentacao()
        {
            string query;
            query = "create table if not exists movto (";
            query += "seqmovto      Integer PRIMARY KEY ON CONFLICT ROLLBACK AUTOINCREMENT Not NULL,";
            query += "placa         text not null,";
            query += "dtamovimento  date not null,";
            query += "dtahorentrada datetime not null,";
            query += "dtahorsaida   datetime default (datetime('now','localtime')),";
            query += "vlrhora       decimal(12,2) Not NULL,";
            query += "qtdehora      decimal(12,2) Not NULL,";
            query += "vlrdesc       decimal(12,2) default (0) Not NULL,";
            query += "vlrtotal      decimal(12,2) Not NULL,";
            query += "seqconvenio   integer,";
            query += "seqmodelo     integer,";
            query += "status        integer Not NULL,";
            query += "motorista     text ,";
            query += "ultnome       text Not NULL,";
            query += "ultdata       datetime default (datetime('now','localtime')),";
            query += "CONSTRAINT fk_seqmodelo FOREIGN KEY(seqmodelo) REFERENCES modelo(seqmodelo),";
            query += "CONSTRAINT fk_seqconvenio FOREIGN KEY(seqconvenio) REFERENCES convenio(seqconvenio))";

            return query;
        }

        public static string gerarTabelaMovtoFormaPagto()
        {
