        #region View do Banco de Dados
        public static string gerarViewTabelaUsuario()
        {
            string query;
            query = "create view if not exists vw_usuario as select sequsuario, nome, login, senha, case ativo when 0 then 'NAO' when 1 then 'SIM' end ativo, ultnome, ultdata from usuario;";

            return query;
        }

        public static string gerarViewTabelaFormaPagto()
        {
            string query;
            query = "create view if not exists vw_formapagto as select seqformapagto,descricao, case ativo when 0 then 'NAO' when 1 then 'SIM' end ativo, ultnome, ultdata from formapagto;";

            return query;
        }

        public static string gerarViewTabelaPessoa()
        {
            string query;
            query = "create view if not exists vw_pessoa as select seqpessoa,cnpjcpf,ierg,razaonome,fantasia,cep,endereco,numero,complemento,bairro,cidade,uf,tipo, case ativo when 0 then 'NAO' when 1 then 'SIM' end ativo, ultnome, ultdata from pessoa;";

            return query;
        }
        
        public static string gerarViewTabelaConvenio()
        {
            string query;
            query = "create view if not exists vw_convenio as select c.seqconvenio, c.seqpessoa, p.razaonome, c.valor, c.ultnome, c.ultdata from convenio c, pessoa p where c.seqpessoa = p.seqpessoa and p.ativo = 1;";

            return query;
        }

        public static string gerarViewTabelaMovimento()
        {
            string query;
            query = "create view if not exists vw_movimento as select m.seqmovto, m.dtamovimento, fp.seqformapagto, fp.descricao,"+
                "m.vlrdesc,m.vlrtotal,mfp.vlrpago from movto m, formapagto fp, movtoformapagto mfp "+
                "where m.seqmovto = mfp.seqmovto and fp.seqformapagto = mfp.seqformapagto; ";

            return query;
        }
        
        public static string gerarViewModeloVeiculo()
        {
            string query;
            query = "create view if not exists vw_modelo as select mo.seqmodelo,mo.descricao modelo," +
                " ma.descricao marca from modelo mo, marca ma where mo.seqmarca = ma.seqmarca";

            return query;
        }
